import { config } from '@gluestack-ui/config'
import { GluestackUIProvider, ImageBackground, View, Image } from '@gluestack-ui/themed'
import React from 'react'

export default function MyAccount() {
    return (
        <GluestackUIProvider config={config}>
            <ImageBackground
                source={require('../img/bg.png')}
                style={{ flex: 1, justifyContent: "center"}}>
                <View>
                    <Image size="xl" borderRadius="$full" source={require('../img/bg.png')} />
                </View>
            </ImageBackground>
        </GluestackUIProvider>
    )
}
